import { Button } from "@primer/react";

const EmojiReact = (props) => {
    const [number, setNumber] = useState(1);

    return(
        <Button onClick={setNumber(number + 1)}>{`❤️ ${number}`}</Button>
    )
}

export default EmojiReact;
